con:config.script:
import com.eviware.soapui.support.GroovyUtils

def fromvar1= context.expand('${#TestCase#fromvar}')
def tovar2= context.expand('${#TestCase#tovar}')
def amtvar3 = context.expand('${#TestSuite#amount}')
def Yest_Day = context.expand('${Properties#Yesterday_date}')
def Today_Day = context.expand('${Properties#Today_date}')

def StepName = context.getCurrentStep().name
def TcName = context.getTestCase().name
def TestSuiteName = context.getTestCase().getTestSuite().name  

def reqXML = context.expand('${TC02_GetConversionAmount#Request}') 

def gutil = new GroovyUtils(context)
def xmlHolder = gutil.getXmlHolder(reqXML)
xmlHolder.namespaces['ns1']= "http://tempuri.org/"
xmlHolder.setNodeValue("//ns1:CurrencyFrom",fromvar1)
xmlHolder.setNodeValue("//ns1:CurrencyTo",tovar2)
xmlHolder.setNodeValue("//ns1:RateDate",Yest_Day)
xmlHolder.setNodeValue("//ns1:Amount",amtvar3)
def ModifiedXML = xmlHolder.getXml()

testRunner.testCase.getTestStepByName("TC02_GetConversionAmount").setPropertyValue("Request",ModifiedXML)
testRunner.testCase.testSuite.project.testSuites[TestSuiteName].testCases[TcName].testSteps["TC02_GetConversionAmount"].run(testRunner,context)

def resXML = context.expand('${TC02_GetConversionAmount#Response}') 
def resxmlHolder = gutil.getXmlHolder(resXML)
resxmlHolder.namespaces['ns1']= "http://tempuri.org/"
def resamount=resxmlHolder.getNodeValue("//ns1:GetConversionAmountResult")
testRunner.testCase.getTestStepByName("Properties").setPropertyValue("Yesterday_Rate",resamount)

def reqXML1 = context.expand('${TC02_GetConversionAmount#Request}') 

def xmlHolder1 = gutil.getXmlHolder(reqXML1)
xmlHolder1.namespaces['ns1']= "http://tempuri.org/"
xmlHolder1.setNodeValue("//ns1:CurrencyFrom",fromvar1)
xmlHolder1.setNodeValue("//ns1:CurrencyTo",tovar2)
xmlHolder1.setNodeValue("//ns1:RateDate",Today_Day)
xmlHolder1.setNodeValue("//ns1:Amount",amtvar3)
def ModifiedXML1 = xmlHolder1.getXml()

testRunner.testCase.getTestStepByName("TC02_GetConversionAmount").setPropertyValue("Request",ModifiedXML1)
testRunner.testCase.testSuite.project.testSuites[TestSuiteName].testCases[TcName].testSteps["TC02_GetConversionAmount"].run(testRunner,context)

def resXML1 = context.expand('${TC02_GetConversionAmount#Response}') 
def resxmlHolder1 = gutil.getXmlHolder(resXML1)
resxmlHolder1.namespaces['ns1']= "http://tempuri.org/"
def resamount1=resxmlHolder1.getNodeValue("//ns1:GetConversionAmountResult")
testRunner.testCase.getTestStepByName("Properties").setPropertyValue("Todays_Rate",resamount1)
